ul {
  margin: 0;
  padding: 0;
  list-style: none;
}

ul.lined li {
  padding-top: 1rem;
  padding-bottom: 1rem;
  border-bottom: 1px solid #eff5f4;
}
ul.lined li:first-child {
  padding-top: 0;
}

ul.spaced li {
  padding-bottom: 1rem;
}
ul.spaced li:last-child {
  padding-bottom: 0;
}

ul.zebra li {
  padding: 0.5rem;
}
ul.zebra li:nth-child(even) {
  background-color: #1f2e2a;
}

ul.hover-highlight li:focus, ul.hover-highlight li:hover {
  border-left: 0.25rem solid #43dbb2;
  padding-left: 0.75rem;
}

.btn {
  padding: 0.5em 1em;
  text-decoration: none;
  font-weight: 600;
  border: 0;
  display: inline-block;
  cursor: pointer;
  font-family: Office Code Pro;
  text-transform: uppercase;
  margin: 5px;
}
.btn--bw {
  color: #eff5f4;
  background-color: transparent;
  position: relative;
  line-height: 1;
  border: 1px solid rgba(239, 245, 244, 0.2);
}
.btn--bw:after {
  content: "";
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 90%;
  height: 70%;
}
.btn--bw:hover {
  border: 1px solid #eff5f4;
  transform: translate(-1px, -1px);
}
.btn--bw:hover:after {
  box-shadow: -1px 1px 1px #43dbb2;
}
.btn--bw:active {
  transform: translate(0, 0);
}
.btn--accent {
  background-color: #43dbb2;
  color: #1a1a1a;
  position: relative;
}
.btn--accent:hover {
  transform: translate(-1px, -1px);
  box-shadow: inset 0 0 0 1px #eff5f4;
  color: #eff5f4;
  background-color: transparent;
}
.btn--accent:active {
  transform: translate(0, 0);
}
.btn--line {
  color: #eff5f4;
  background-color: transparent;
  border: 1px solid rgba(239, 245, 244, 0.2);
}
.btn--line:hover {
  background-color: #43dbb2;
  color: #1a1a1a;
  border: 1px solid #43dbb2;
}

