sources.styles\\_layout.scss:
@use 'variables' as *;

//
// Display
//

$display: (
    'block': block,
    'inline-block': inline-block,
    'inline': inline,
    'flex': flex,
    'inline-flex': inline-flex,
    'grid': grid,
    'inline-grid': inline-grid,
    'hidden': none,
) !default;

@each $option, $value in $display {
    .#{$option} {
        display: $value;
    }

    @each $size, $px in $screens {
        @media screen and (min-width: $px) {
            .#{$size}\:#{$option} {
                display: $value;
            }
        }
    }
}

//
// Flexbox
//

$flex-direction: (
    'row': row,
    'row-reverse': row-reverse,
    'col': column,
    'col-reverse': column-reverse,
);

@each $direction, $value in $flex-direction {
    .flex-#{$direction} {
        flex-direction: $value;
    }

    @each $size, $px in $screens {
        @media screen and (min-width: $px) {
            .#{$size}\:flex-#{$direction} {
                flex-direction: $value;
            }
        }
    }
}

$flex-wrap: (
    'wrap': wrap,
    'wrap-reverse': wrap-reverse,
    'no-wrap': nowrap,
);

@each $wrap, $value in $flex-wrap {
    .flex-#{$wrap} {
        flex-wrap: $value;
    }

    @each $size, $px in $screens {
        @media screen and (min-width: $px) {
            .#{$size}\:flex-#{$wrap} {
                flex-wrap: $value;
            }
        }
    }
}

$flex-items: (
    'start': flex-start,
    'end': flex-end,
    'center': center,
    'baseline': baseline,
    'stretch': stretch,
);

@each $alignment, $value in $flex-items {
    .items-#{$alignment} {
        align-items: $value;
    }
    @each $size, $px in $screens {
        @media screen and (min-width: $px) {
            .#{$size}\:items-#{$alignment} {
                align-items: $value;
            }
        }
    }
}

$flex-content: (
    'center': center,
    'start': flex-start,
    'end': flex-end,
    'between': space-between,
    'around': space-around,
);

@each $alignment, $value in $flex-content {
    .content-#{$alignment} {
        align-content: $value;
    }

    .justify-#{$alignment} {
        justify-content: $value;
    }

    @each $size, $px in $screens {
        @media screen and (min-width: $px) {
            .#{$size}\:content-#{$alignment} {
                align-content: $value;
            }
        }
    }

    @each $size, $px in $screens {
        @media screen and (min-width: $px) {
            .#{$size}\:justify-#{$alignment} {
                justify-content: $value;
            }
        }
    }
}

.justify-evenly {
    justify-content: space-evenly;
}

@each $size, $px in $screens {
    @media screen and (min-width: $px) {
        .#{$size}\:justify-evenly {
            justify-content: space-evenly;
        }
    }
}

$flex: (
    '1': 1 1 0%,
    'auto': 1 1 auto,
    'initial': 0 1 auto,
    'none': none,
);

@each $item, $value in $flex {
    .flex-#{$item} {
        flex: $value;
    }

    @each $size, $px in $screens {
        @media screen and (min-width: $px) {
            .#{$size}\:flex-#{$item} {
                flex: $value;
            }
        }
    }
}

sources.styles\\_lists.scss:
@use 'variables' as *;

ul {
    margin: 0;
    padding: 0;
    list-style: none;
}

ul.lined {
    li {
        padding-top: 1rem;
        padding-bottom: 1rem;
        border-bottom: 1px solid $secondary;
        &:first-child {
            padding-top: 0;
        }
    }
}

ul.spaced {
    li {
        padding-bottom: 1rem;
        &:last-child {
            padding-bottom: 0;
        }
    }
}

ul.zebra {
    li {
        padding: 0.5rem;
        &:nth-child(even) {
            background-color: $accent-dark;
        }
    }
}

ul.hover-highlight {
    li {
        &:focus,
        &:hover {
            border-left: 0.25rem solid $accent;
            padding-left: 0.75rem;
        }
    }
}

sources.styles\\_buttons.scss:
@use 'variables' as *;
@use "sass:color";

.btn {
    padding: 0.5em 1em;
    text-decoration: none;
    font-weight: 600;
    border: 0;
    display: inline-block;
    cursor: pointer;
    font-family: Office Code Pro;
    text-transform: uppercase;
    margin: 5px;
    &--bw {
        color: $secondary;
        background-color: transparent;
        position: relative;
        line-height: 1;
        border: 1px solid color.adjust($secondary, $alpha: -0.8);
        &:after {
            content: '';
            // background-color: color.adjust($secondary, $alpha: -0.9);
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            width: 90%;
            height: 70%;
        }
        &:hover {
            border: 1px solid $secondary;
            transform: translate(-1px, -1px);
            &:after {
                box-shadow: -1px 1px 1px $accent;
            }
        }
        &:active {
            transform: translate(0, 0);
        }
    }

    &--accent {
        background-color: $accent;
        color: $primary;
        position: relative;
        &:hover {
            transform: translate(-1px, -1px);
            box-shadow: inset 0 0 0 1px $secondary;
            color: $secondary;
            background-color: transparent;
        }
        &:active {
            transform: translate(0, 0);
        }
    }

    &--line {
        color: $secondary;
        background-color: transparent;
        border: 1px solid color.adjust($secondary, $alpha: -0.8);
        &:hover {
            background-color: $accent;
            color: $primary;
            border: 1px solid $accent;
        }
    }
}
